import React from "react";
import "../admincss/AdminSideBar.css";

const AdminSidebar = ({ activeTab, setActiveTab }) => {
  const sidebarItems = [
    { id: "sales", label: "Îß§Ï∂ú ÌòÑÌô©", icon: "üìä" },
    { id: "staff", label: "ÏßÅÏõê Í¥ÄÎ¶¨", icon: "üë•" },
    { id: "users", label: "ÌöåÏõê Í¥ÄÎ¶¨", icon: "üë§" },
    { id: "theaters", label: "Í∑πÏû• Í¥ÄÎ¶¨", icon: "üè¢" },
    { id: "movies", label: "ÏòÅÌôî Í¥ÄÎ¶¨", icon: "üé¨" },
    { id: "screens", label: "ÏÉÅÏòÅÍ¥Ä Í¥ÄÎ¶¨", icon: "üé≠" },
    { id: "reservations", label: "ÏòàÏïΩ Í¥ÄÎ¶¨", icon: "üé´" },
    { id: "inquiries", label: "Í≥†Í∞ù ÏßÄÏõê", icon: "üí¨" },
    { id: "events", label: "Ïù¥Î≤§Ìä∏ Í¥ÄÎ¶¨", icon: "üéâ" },
  ];

  return (
    <div className="adsb-sidebar">
      <nav className="adsb-sidebar-nav">
        {sidebarItems.map((item) => (
          <button
            key={item.id}
            className={`adsb-sidebar-item ${
              activeTab === item.id ? "adsb-active" : ""
            }`}
            onClick={() => setActiveTab(item.id)}
          >
            <span className="adsb-sidebar-icon">{item.icon}</span>
            <span className="adsb-sidebar-label">{item.label}</span>
          </button>
        ))}
      </nav>
    </div>
  );
};

export default AdminSidebar;
